import React from 'react';
import '../index.scss';

const Drawer = () => {
  return (
    <section class="content">
      <div className="buy">
        <h1>Моя корзина</h1>
        <div className="buyall">Купить все</div>
      </div>

      <div class="cards">
        <div class="card">
          <img className="delete" src="/img/del.png" alt="" />
          <img src="/img/sneakers/sneak1.png" alt="" />
          <div class="cardofitems">
            <div class="card-name">
              <p class="name-line">Nike dunk Hi Retro</p>
              <p class="price-line">11999 p.</p>
            </div>
            <img class="to-get" src="/img/to-get.png" alt="" />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Drawer;
